import React, { useState } from 'react'

const Map = props => {

  return (
    <div id="google-map">
      Map
    </div>
  )
}

export async function getStaticProps() {
  const res = await fetch(`https://maps.googleapis.com/maps/api/js?key=${process.env.GOOGLE_MAPS_API_KEY}&callback=initMap`)
  const initMap = await res.json()
}


export default Map
